            "_id": "62848024a3d2d9cd1847e80e",
            "question": "How do you help morale? (e.g., when the crew was supposed to go home but needs to stay active/at sea?)",
            "confidence": -0.4133256161851926,
            "classifierAnswerType": "CLASSIFIER",
            "feedback": "NEUTRAL",
            "updatedAt": "2022-05-18T05:12:04.606Z",
